export default (function(a,b,c,d,e,f,g,h,i){return {data:{a2pA1vTMvU:{data:{id:2237,attributes:{imdbId:"tt1401152",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BODA4NTk3MTQwN15BMl5BanBnXkFtZTcwNjUwMTMxNA@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.8\u002F10"},{Source:"Rotten Tomatoes",Value:"55%"},{Source:"Metacritic",Value:"56\u002F100"}],item_lang:{data:{id:2900,attributes:{title:e,plot:"A biochemist and his dishy wife arrive in Berlin for a conference at which a scientist and his controversial Arab funder will announce breakthrough research. While his wife checks into the hotel, he grabs a cab to return to the airport for his briefcase, left at the curb. En route, an auto accident puts him in a coma, from which he awakes four days later without identification and with gaps in his memory. He goes to the hotel: his wife refuses to recognize him and another man has claimed his identity. With help from a nurse, the cab driver, a retired Stasi agent, and an academic friend, he tries to unravel what's going on. Is the answer in the briefcase?",slug:"unknown"}}},books:{data:[{id:10949,attributes:{title:f,description:g,thumbnail:h,authors:[a],firstBook:true,published:i,publisher:b,subtitle:c}},{id:10950,attributes:{title:f,description:g,thumbnail:h,authors:[a],firstBook:d,published:i,publisher:b,subtitle:c}},{id:10951,attributes:{title:"One-way",description:"\"It is on the plane to Morocco that events take an unexpected turn, when Aziz, pressed for details of a \"birthplace\" that is not his, invents the fabulous story of Irghiz, a valley paradise hidden from the world and now in danger of ruin. From this moment on, the attache forgets his original assignment and has only one mission: to return Aziz to the Eldorado he left behind and save it from the ravages of modern progress. So begins an initiatory journey that takes Aziz, Jean-Pierre, and a disabused aristocrat named Valerie d'Armeray de Villeneuve across a desert both real and mythic, pursuing a vision of happiness as elusive as Irghiz itself.\"--BOOK JACKET.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=yJ0bAQAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2003-01-01",publisher:b,subtitle:c}},{id:10952,attributes:{title:e,description:"Martin Harris returns home after a short absence to find that his wife doesn't know him and another man is living in his house under his name. The imposter shares all of Martin's memories, experiences, and knowledge down to the last detail. Is it conspiracy? Amnesia? An elaborate hoax or his own paranoid delusion? Part moral fable, part thriller, Unknown is a fast-paced tale of one man's desperate attempt to reclaim his existence-even at the cost of his own life. Watch a Video",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zJ-vnuDNX8kC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Didier Van Cauwelaert"],firstBook:d,published:"2011-01-12",publisher:"Penguin",subtitle:"A Novel"}}]}}},meta:{}}},prerenderedAt:1680940934118}}("Didier van Cauwelaert","Other PressLlc","",null,"Unknown","Out of My Head","In a tale that explores a theme of the illusory nature of identity and the instability of things taken for granted, everyman Martin Harris finds himself inexplicably dispossessed of his job, family, name, and past and launches a desperate attempt to reclaim his existence. By the author of One-Way. Reprint.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=QOCMHnUrI_oC&printsec=frontcover&img=1&zoom=5&source=gbs_api","2005-01-01"))